import { AfterViewInit, Component, ElementRef, Input, OnDestroy, OnInit, Renderer2, ViewChild } from '@angular/core';
import { environment } from '@env';
import { ConfigurateurService, Modele } from '../configurateur.service';
import { Configuration } from '../configuration.model';
import { jsPDF } from 'jspdf';
import { BehaviorSubject, Observable, Subject } from 'rxjs';
import { filter, skip, take, takeUntil, tap } from 'rxjs/operators';
import { Produit } from '@/_util/models';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { ProduitService } from '@core/_services/produit.service';
import { HttpClient } from '@angular/common/http';
import { saveAs } from 'file-saver';
import {AuthenticationService, WindowService} from '@core/_services';
import { CurrencyPipe, DatePipe } from '@angular/common';

const TrebuchetMS = '';

@Component({
	selector: 'conf-export',
	templateUrl: './export.component.html',
	styleUrls: ['./export.component.scss'],
	providers: [DatePipe, CurrencyPipe]
})
export abstract class ExportComponent implements OnInit, OnDestroy, AfterViewInit {

	@ViewChild('doc') content: ElementRef<HTMLElement>;
	@ViewChild('html') content2: ElementRef<HTMLElement>;

	environment = environment;

	@Input() set configuration(value: Configuration) {
		this.modele = this.configService.modeles.find(modele => modele.produit === value.modele);
		this.exportForm.get('id').setValue(value.id);
		this._configuration.next(value);
		this._buildForm();
	}
	get configuration(): Configuration {
		return this._configuration.value;
	}

	public modele: Modele;
	public showPopup = false;
	public mailSent = false;
	public exportForm: FormGroup;

	protected _configuration = new BehaviorSubject<Configuration>(null);
	protected _doc = new jsPDF('p', 'pt', 'a4');
	protected _scale = 0;
	protected _destroy$ = new Subject<void>();

	constructor(
		public http: HttpClient,
		public configService: ConfigurateurService,
		public produitService: ProduitService,
		protected authService: AuthenticationService,
		protected fb: FormBuilder,
		protected renderer: Renderer2,
		protected datePipe: DatePipe,
		protected currencyPipe: CurrencyPipe,
    protected window: WindowService
	) {

	}

	ngOnInit(): void {
		this._buildForm();
	 }

	ngOnDestroy(): void {
		this._destroy$.next();
		this._destroy$.complete();
	}

	ngAfterViewInit(): void {
		this._configuration.pipe(takeUntil(this._destroy$)).subscribe(() => {
			this.init();
		});
	}

	/**
	 * Reconstruit le formulaire d'exportation.
	 */
	protected _buildForm(): void {
		this.exportForm = this.fb.group({
			id: [this._configuration.value?.id, ''],
			type: ['pdf', [Validators.required]],
			mail: [this.authService.currentUser?.TIERSMEL ?? 'email@email.com'],
			name: [this._configuration.value?.name ?? ''],
			commentaires: [this._configuration.value?.commentaires ?? '']
		});
	}

	/**
	 * Affiche la popup d'exportation.
	 */
	public show(): void {
		this.showPopup = true;
	}

	/**
	 * Initialise les variables du document.
	 */
	public init(): void {
		this._doc = new jsPDF('p', 'pt', 'a4'); // création du pdf
		const pwidth = this._doc.internal.pageSize.width;
		const srcWidth = this.content2.nativeElement.scrollWidth;
		this._scale = (pwidth) / srcWidth; // échelle de scaling pour dimensionner correctement le pdf
		this.modele = this.configService.modeles.find(modele => modele.produit === this.configuration.modele);
		/** !! A NE TOUCHER QUE SI VOUS SAVEZ CE QUE VOUS FAITES !! */
		this._doc.addFileToVFS('Trebuchet MS-normal.ttf', TrebuchetMS); // font utilisée par le pdf
		this._doc.addFont('Trebuchet MS-normal.ttf', 'Trebuchet MS', 'normal');
		this._doc.setFont('Trebuchet MS');
	}

	/**
	 * Génère un pdf et permet à l'utilisateur de le télécharger.
	 *
	 * @link voir https://stackoverflow.com/a/54847643
	 */
	public generatePDF(): void {
		this.init();
		this._buildHTML().pipe(take(1)).subscribe(() => {
			setTimeout(() => {
				this._doc.html(this.content2.nativeElement, {
					x: 0,
					y: 0,
					html2canvas: {
						scale: this._scale
					},
					callback: (doc) => {
						doc.setFontSize(16 / this._scale);
						doc.save((this.exportForm.get('name').value || 'Ma première configuration') + '.pdf');
					}
				});
			});
		});
	}

	/**
	 * Génère un fichier .csv et permet à l'utilisateur de le télécharger.
	 */
	public generateCSV(): void {
		const header = ['marque', 'reference', 'prix ht unitaire', 'quantite'];
		const csv = [];
		this.configService.configuration.configuration.forEach(group => {
			group.forEach(category => {
				category.forEach(option => {
					if (option?.option?.['produit'].value && option.quantite > 0) {
						const produit = this.configService.produits.find(p => p.reference === option.option['produit'].value);
						csv.push([produit.marquelib, produit.reference, produit.prix, option.quantite].join(','));
					}
				});
			});
		});
		csv.unshift(header.join(','));
		const csvFile = csv.join('\r\n');
		const blob = new Blob([csvFile], { type: 'text/csv' });
		saveAs(blob, (this.exportForm.get('name').value || 'Ma première configuration') + '.csv');
	}

	/**
	 * Envoi un mail contenant la configuration à l'utilisateur.
	 */
	public sendMail(): void {
		const packet = [];
		this.configService.configuration.configuration.forEach(group => {
			group.forEach(category => {
				category.forEach(option => {
					if (option?.option?.['produit'].value && option.quantite > 0) {
						const produit = this.configService.produits.find(p => p.reference === option.option['produit'].value);
						packet.push([produit.marquelib, produit.reference, produit.prix, option.quantite]);
					}
				});
			});
		});
		this.http.post(
			`${environment.apiUrl}/ExportConfiguration.php`,
			{
				marque: this.configService.marque,
				configuration: JSON.stringify(packet),
				mail: this.exportForm.get('mail').value,
				nom: this.exportForm.get('name').value || 'Ma première configuration',
				date: this.configService.configuration.date.toLocaleDateString('fr', { year: 'numeric', month: 'long', day: 'numeric' }),
				commentaires: this.exportForm.get('commentaires').value
			},
			{
				withCredentials: true
			})
			.pipe(take(1))
			.subscribe(() => this.mailSent = true);
	}

	/**
	 * Renvoie les détails d'un produit à partir de sa référence.
	 *
	 * @param reference La référence d'un produit
	 * @returns Un produit
	 */
	getProduitDetails(reference: string): Produit {
		return this.configService.produits.find(produit => produit.reference === reference);
	}

	/**
	 * Cache la popup d'exportation.
	 */
	public onHidePopup(): void {
		this.showPopup = false;
		this.mailSent = false;
	}

	/**
	 * Évènement lors du clic sur le bouton Exporter.
	 *
	 * Exporte la configuration selon le format choisi
	 */
	public onExporter(): void {
		if (this.exportForm.valid) {
			switch (this.exportForm.get('type').value) {
				case 'pdf':
					this.generatePDF();
					this.onHidePopup();
					break;
				case 'excel':
					this.generateCSV();
					this.onHidePopup();
					break;
				case 'mail':
					this.sendMail();
					break;
			}
		}
	}

	/**
	 * Construit le HTML.
	 */
	protected _buildHTML(): Observable<void> {
		this.content2.nativeElement.childNodes.forEach(child => {
			this.renderer.removeChild(this.content2.nativeElement, child);
		})
		const ret$ = new Subject<void>();
		const nextLine$ = new Subject<number>();
		const done$ = new Subject<void>();
		let lineCount = 0;

		const header = this._buildHeader();
		const footer = this._buildFooter();
		let currentHeader = header;
		let currentFooter = footer;
		let page = this._buildPage(header, footer);

		// Construction de la présentation du modèle
		const modele = this.renderer.createElement('div');
		this.renderer.appendChild(page, modele);
		this.renderer.addClass(modele, 'modele');
		const titleModele = this.renderer.createElement('h2');
		this.renderer.appendChild(titleModele, this.renderer.createText('Modèle configuré'));
		this.renderer.appendChild(modele, titleModele);
		this.renderer.appendChild(modele, this.renderer.createElement('hr'));
		const detail = this.renderer.createElement('div');
		this.renderer.addClass(detail, 'detail');
		const modelePhoto = this.renderer.createElement('img');
		this.renderer.setAttribute(modelePhoto, 'src', `${environment.photosUrl}${this.modele.photo}.webp`);
		this.renderer.setAttribute(modelePhoto, 'alt', this.configuration.modele);
		this.renderer.appendChild(detail, modelePhoto);
		this.renderer.appendChild(modele, detail);
		const description = this.renderer.createElement('div');
		this.renderer.addClass(description, 'description');
		const modeleName = this.renderer.createElement('h3');
		this.renderer.appendChild(modeleName, this.renderer.createText(this.configuration.modele));
		const modeleDescription = this.renderer.createElement('p');
		this.renderer.appendChild(modeleDescription, this.renderer.createText(this.modele.description));
		const modeleFonctionsTitle = this.renderer.createElement('h4');
		this.renderer.appendChild(modeleFonctionsTitle, this.renderer.createText('Fonctions principales'));
		const modeleFonctions = this.renderer.createElement('p');
		this.renderer.addClass(modeleFonctions, 'fonction');
		this.renderer.appendChild(modeleFonctions, this.renderer.createText(this.produitService.fullString(this.modele.details)));
		this.renderer.appendChild(description, modeleName);
		this.renderer.appendChild(description, modeleDescription);
		this.renderer.appendChild(description, modeleFonctionsTitle);
		this.renderer.appendChild(description, modeleFonctions);
		this.renderer.appendChild(detail, description);
		const commentairesBloc = this.renderer.createElement('div');
		const commentairesTitle = this.renderer.createElement('h4');
		this.renderer.appendChild(commentairesTitle, this.renderer.createText('Commentaires :'));
		const commentaires = this.renderer.createElement('p');
		this.renderer.addClass(commentaires, 'commentaires');
		this.renderer.appendChild(commentaires, this.renderer.createText(this.exportForm.get('commentaires').value));
		this.renderer.appendChild(commentairesBloc, commentairesTitle);
		this.renderer.appendChild(commentairesBloc, commentaires);
		this.renderer.appendChild(modele, commentairesBloc);

		// Construction du récapitulatif
		const recapitulatif = this.renderer.createElement('div');
		let currentRecap = recapitulatif as Node;
		this.renderer.appendChild(page, recapitulatif);
		this.renderer.addClass(recapitulatif, 'recapitulatif');
		const recapTitle = this.renderer.createElement('h2');
		this.renderer.appendChild(recapTitle, this.renderer.createText('Récapitulatif des options choisies'));
		this.renderer.appendChild(recapitulatif, recapTitle);
		this.renderer.appendChild(recapitulatif, this.renderer.createElement('hr'));
		// pour chaque groupe d'option de la configuration
		this.configuration.configuration.forEach((categories, group) => {
			// si ce groupe possède des options non nulles ou avec des quantités > 0
			if (this.configuration.getNbCategoryChoices(group)) {
				let bloc = this._buildBlocRecap(group);
				let index = -1;
				// pour chaque option, on vient créer une ligne dans le récap
				categories.forEach((options, categorie) => {
					options.forEach(option => {
						if (option.option && option.quantite > 0) {
							const f = lineCount + 0; // ligne actuelle totale
							const i = ++index; // ligne actuelle du bloc courant
							lineCount++;
							nextLine$.pipe(filter(v => v === f), take(1)).subscribe(() => {
								const tr = this.renderer.createElement('tr');
								// description
								let td = this.renderer.createElement('td');
								this.renderer.addClass(td, 'description');
								this.renderer.addClass(td, 'left');
								let span = this.renderer.createElement('span');
								this.renderer.addClass(span, 'weight-bold');
								if (group === 'Services') {
									this.renderer.appendChild(span, this.renderer.createText(option.option.produit.value));
								} else {
									this.renderer.appendChild(span, this.renderer.createText(categorie));
								}
								this.renderer.appendChild(td, span);
								this.renderer.appendChild(td, this.renderer.createElement('br'));
								span = this.renderer.createElement('span');
								this.renderer.addClass(span, 'size-small');
								const red = this.renderer.createElement('span');
								this.renderer.addClass(red, 'red');
								this.renderer.appendChild(red, this.renderer.createText(`${option.option[option.option['Cible'].value].value || option.option['Durée'].value} ${option.option['Unité'].value}`));
								this.renderer.appendChild(span, red);
								if (group === 'Équipement additionnel') {
									this.renderer.appendChild(span, this.renderer.createText(this.configService.produits.find(produit => produit.reference === option.option.produit.value)?.designation ?? ''));
								} else if (group === 'Services') {
									this.renderer.appendChild(span, this.renderer.createText(option.option.description.value));
								} else {
									this.renderer.appendChild(span, this.renderer.createText(` - ${this.configService.getTexte(option.option['Gamme'].value, categorie)}`));
								}
								this.renderer.appendChild(td, span);
								this.renderer.appendChild(tr, td);
								// référence
								td = this.renderer.createElement('td');
								this.renderer.addClass(td, 'size-smaller');
								this.renderer.appendChild(td, this.renderer.createText(option.option.produit.value));
								this.renderer.appendChild(tr, td);
								// disponibilité
								td = this.renderer.createElement('td');
								this.renderer.addClass(td, 'size-smaller');
								this.renderer.addClass(td, 'center');
								const produit = this.configService.produits.find(produit => produit.reference === option.option.produit.value);
								if (produit.gabarit === 'V') {
									this.renderer.appendChild(td, this.renderer.createText('Produit dématérialisé'));
								} else if (produit.qteStock1 > 0) {
									this.renderer.addClass(td, 'stock');
									this.renderer.addClass(td, 'en-stock');
									this.renderer.appendChild(td, this.renderer.createText(`${produit.qteStock1} en stock`));
								} else if (produit.qteStock2 > 2) {
									this.renderer.addClass(td, 'stock');
									this.renderer.appendChild(td, this.renderer.createText(`${produit.qteStock2} sur stock externe`));
								} else if (produit.qteEnReappro > 0) {
									this.renderer.addClass(td, 'stock');
									this.renderer.appendChild(td, this.renderer.createText(`${produit.qteEnReappro} en réappro.`));
								} else {
									this.renderer.addClass(td, 'stock');
									this.renderer.appendChild(td, this.renderer.createText('0 en stock'));
								}
								this.renderer.appendChild(tr, td);
								// prix
								td = this.renderer.createElement('td');
								this.renderer.addClass(td, 'prix');
								this.renderer.appendChild(td, this.renderer.createText(this.currencyPipe.transform(option.option.prix.value, 'EUR', 'symbol', '1.2-2', 'fr')));
								this.renderer.appendChild(tr, td);
								// quantité
								td = this.renderer.createElement('td');
								this.renderer.addClass(td, 'size-smaller');
								this.renderer.appendChild(td, this.renderer.createText(option.quantite.toString()));
								this.renderer.appendChild(tr, td);

								this.renderer.appendChild(bloc.childNodes.item(0).childNodes.item(1), tr);
								this.renderer.appendChild(currentRecap, bloc);
								// timeout pour laisser le temps au navigateur de créer le layout
								setTimeout(() => {
									// si le bloc déborde sur le footer, on retire la ligne qu'on vient d'ajouter et on crée une nouvelle page
									if (this.window.isElementOverflowing(bloc, currentFooter)) {
										if (i === 0) {
											this.renderer.removeChild(currentRecap, bloc);
										} else {
											this.renderer.removeChild(bloc.childNodes.item(0).childNodes.item(1), tr);
										}
										currentHeader = header.cloneNode(true);
										currentFooter = footer.cloneNode(true);
										page = this._buildPage(currentHeader, currentFooter);
										bloc = this._buildBlocRecap(group);
										this.renderer.appendChild(bloc.childNodes.item(0).childNodes.item(1), tr);
										currentRecap = currentRecap.cloneNode(false);
										this.renderer.appendChild(currentRecap, bloc);
										this.renderer.appendChild(page, currentRecap);
									}
									nextLine$.next(f + 1);
								});
							});
						}
					});
				});
			}
		});
		nextLine$.next(0); // trigger l'observable pour démarrer la création du récap
		// une fois que toutes les lignes ont été créées
		nextLine$.pipe(skip(lineCount - 1), take(1)).subscribe(() => {
			// prix total
			const prix = this.renderer.createElement('prix');
			this.renderer.appendChild(page, prix);
			this.renderer.addClass(prix, 'prix');
			const textePrix = this.renderer.createElement('div');
			const textePrixTitle = this.renderer.createElement('h1');
			const textePrixSubtitle = this.renderer.createElement('p');
			this.renderer.appendChild(textePrixTitle, this.renderer.createText('Prix HT de votre configuration'));
			this.renderer.appendChild(textePrixSubtitle, this.renderer.createText('(sur la base des options sélectionnées)'));
			this.renderer.appendChild(textePrix, textePrixTitle);
			this.renderer.appendChild(textePrix, textePrixSubtitle);
			const blocPrix = this.renderer.createElement('div');
			this.renderer.addClass(blocPrix, 'bloc-prix');
			const blocPrixPrix = this.renderer.createElement('h2');
			this.renderer.appendChild(blocPrixPrix, this.renderer.createText(this.currencyPipe.transform(this.configuration.prix, 'EUR', 'symbol', '1.2-2', 'fr')));
			const blocPrixQuantite = this.renderer.createElement('p');
			this.renderer.appendChild(blocPrixQuantite, this.renderer.createText(`Quantité : 1`));
			this.renderer.appendChild(blocPrix, blocPrixPrix);
			this.renderer.appendChild(blocPrix, blocPrixQuantite);
			this.renderer.appendChild(prix, textePrix);
			this.renderer.appendChild(prix, blocPrix);
			// timeout pour laisser le navigateur placer le prix, si ça déborde on fait une nouvelle page encore
			setTimeout(() => {
				if (this.window.isElementOverflowing(prix, currentFooter)) {
					this.renderer.removeChild(page, prix);
					currentHeader = header.cloneNode(true);
					currentFooter = footer.cloneNode(true);
					page = this._buildPage(currentHeader, currentFooter);
					this.renderer.appendChild(page, prix);
				}
				done$.next();
			});
		});

		// une fois que tout est fini, on annonce la fin du traitement
		done$.pipe(take(1)).subscribe(() => {
			ret$.next();
			ret$.complete();
		})
		return ret$;
	}

	/**
	 * Construit le header de la page HTML d'exportation.
	 * @returns Le noeud HTML du header
	 */
	protected _buildHeader(): Node {
		const header = this.renderer.createElement('div') as Node;
		this.renderer.addClass(header, 'header');
		const logo_gauche = this.renderer.createElement('img');
		this.renderer.setAttribute(logo_gauche, 'src', 'assets/img/logo_actn_white.webp');
		this.renderer.appendChild(header, logo_gauche);
		const div = this.renderer.createElement('div');
		const title = this.renderer.createElement('h1');
		this.renderer.appendChild(
			title,
			this.renderer.createText(`${this.exportForm.get('name').value || ('Configuration du ' + (this.datePipe.transform(this.configuration.date, 'shortDate')))}`)
		);
		const span = this.renderer.createElement('span');
		this.renderer.appendChild(span, this.renderer.createText(`| #ID : ${this.configuration.id}`));
		this.renderer.appendChild(title, span);
		const date = this.renderer.createElement('p');
		this.renderer.appendChild(
			date,
			this.renderer.createText(`Exporté le : ${this.datePipe.transform(this.configuration.date, 'dd/MM/yyyy à HH:mm:ss')}`)
		);
		this.renderer.appendChild(div, title);
		this.renderer.appendChild(div, date);
		this.renderer.appendChild(header, div);
		const logo_droite = this.renderer.createElement('img');
		this.renderer.addClass(logo_droite, 'logo-marque');
		this.renderer.setAttribute(logo_droite, 'src', `assets/img/${this.configService.marque}.webp`);
		this.renderer.appendChild(header, logo_droite);
		return header;
	}

	/**
	 * Construit le footer de la page HTML d'exportation.
	 * @returns Le noeud HTML du footer
	 */
	protected _buildFooter(): Node {
		const footer = this.renderer.createElement('div') as Node;
		this.renderer.addClass(footer, 'footer');
		let p = this.renderer.createElement('p');
		this.renderer.appendChild(p, this.renderer.createText('Document non contractuel - Estimatif réalisé sur la base des prix pratiqués à la date indiquée sur '));
		const siteWeb = this.renderer.createElement('a');
		this.renderer.appendChild(siteWeb, this.renderer.createText('www.actn.fr'));
		this.renderer.setAttribute(siteWeb, 'href', 'https://www.actn.fr');
		this.renderer.appendChild(p, siteWeb);
		this.renderer.appendChild(footer, p);
		p = this.renderer.createElement('p');
		this.renderer.appendChild(p, this.renderer.createText('Pour toute question, veuillez prendre contact avec l\'équipe commerciale au '));
		const lienTel = this.renderer.createElement('a');
		this.renderer.appendChild(lienTel, this.renderer.createText('05 62 488 488'));
		this.renderer.setAttribute(lienTel, 'href', 'tel:+33562488488');
		this.renderer.appendChild(p, lienTel);
		this.renderer.appendChild(footer, p);
		return footer;
	}

	/**
	 * Construit une page du HTML d'exportation.
	 * @param header Un noeud HTML correspondant au header, à cloner avant
	 * @param footer Un noeud HTML correspondant au footer, à cloner avant
	 * @returns Le noeud HTML d'une nouvelle page
	 */
	protected _buildPage(header: Node, footer: Node): Node {
		const page = this.renderer.createElement('div') as Node;
		this.renderer.addClass(page, 'page');
		this.renderer.appendChild(page, header);
		this.renderer.appendChild(page, footer);
		this.renderer.appendChild(this.content2.nativeElement, page)
		return page;
	}

	/**
	 * Construit un bloc du récapitulatif de la page HTML d'exportation.
	 * @param group Le nom du groupe d'options en cours
	 * @returns Le noeud HTML du nouveau bloc
	 */
	protected _buildBlocRecap(group: string): Node {
		const bloc = this.renderer.createElement('div') as Node;
		this.renderer.addClass(bloc, 'bloc');
		this.renderer.addClass(bloc, 'raised-1');
		const table = this.renderer.createElement('table');
		const thead = this.renderer.createElement('thead');
		const tbody = this.renderer.createElement('tbody');
		const tr = this.renderer.createElement('tr');
		const th1 = this.renderer.createElement('th');
		this.renderer.addClass(th1, 'left');
		this.renderer.appendChild(th1, this.renderer.createText(group));
		const th2 = this.renderer.createElement('th');
		this.renderer.appendChild(th2, this.renderer.createText('Référence'));
		const th3 = this.renderer.createElement('th');
		this.renderer.appendChild(th3, this.renderer.createText('Disponibilité'));
		const th4 = this.renderer.createElement('th');
		this.renderer.appendChild(th4, this.renderer.createText('Prix HT'));
		const th5 = this.renderer.createElement('th');
		this.renderer.appendChild(th5, this.renderer.createText('Quantité'));
		this.renderer.appendChild(tr, th1);
		this.renderer.appendChild(tr, th2);
		this.renderer.appendChild(tr, th3);
		this.renderer.appendChild(tr, th4);
		this.renderer.appendChild(tr, th5);
		this.renderer.appendChild(thead, tr);
		this.renderer.appendChild(table, thead);
		this.renderer.appendChild(table, tbody);
		this.renderer.appendChild(bloc, table);
		return bloc;
	}

}
